import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import { useTranslation } from 'react-i18next';
import './Footer.css';

const Footer = () => {
  const { t } = useTranslation();

  const footerVariants = {
    hidden: {},
    visible: {
      transition: {
        staggerChildren: 0.1
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: { opacity: 1, y: 0 }
  };

  return (
    <footer className="footer">
      <div className="footer-pattern-overlay"></div>
      <div className="footer-gradient-overlay"></div>

      <div className="container">
        <motion.div 
          className="footer-content"
          variants={footerVariants}
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true }}
        >
          {/* Company Info */}
          <motion.div className="footer-section" variants={itemVariants}>
            <div className="company-info">
              <h3>{t('footer.about')}</h3>
              <p>{t('footer.aboutText')}</p>
              <div className="social-links">
                <a href="https://instagram.com" target="_blank" rel="noopener noreferrer" className="social-link">
                  <i className="fab fa-instagram"></i>
                </a>
                <a href="https://facebook.com" target="_blank" rel="noopener noreferrer" className="social-link">
                  <i className="fab fa-facebook"></i>
                </a>
                <a href="https://twitter.com" target="_blank" rel="noopener noreferrer" className="social-link">
                  <i className="fab fa-twitter"></i>
                </a>
              </div>
            </div>
          </motion.div>

          {/* Quick Links */}
          <motion.div className="footer-section" variants={itemVariants}>
            <h3>{t('footer.quickLinks')}</h3>
            <div className="footer-links">
              <Link to="/">{t('nav.home')}</Link>
              <Link to="/hizmetler">{t('nav.services')}</Link>
              <Link to="/galeri">{t('nav.works')}</Link>
              <Link to="/arabalar">{t('nav.cars')}</Link>
              <Link to="/iletisim">{t('nav.contact')}</Link>
            </div>
          </motion.div>

          {/* Contact Info */}
          <motion.div className="footer-section" variants={itemVariants}>
            <h3>{t('footer.contact.title')}</h3>
            <div className="contact-info">
              <div className="contact-item">
                <i className="fas fa-map-marker-alt"></i>
                <span>{t('footer.contact.address')}: Ankara, Türkiye</span>
              </div>
              <div className="contact-item">
                <i className="fas fa-phone"></i>
                <span>{t('footer.contact.phone')}: +90 555 555 55 55</span>
              </div>
              <div className="contact-item">
                <i className="fas fa-envelope"></i>
                <span>{t('footer.contact.email')}: info@detailinx.com</span>
              </div>
            </div>
          </motion.div>
        </motion.div>

        <div className="footer-bottom">
          <p>© 2024 DetailinX - {t('footer.rights')}</p>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
